import React from 'react';
import { useAuth } from './Autenticacion';
import './Header.css';
import LogoImg from '../Imagenes/Logo.png';

function Header() {
  const { isAuthenticated, logout } = useAuth();

  return (
    <header className="Header">
      <div className="Header-logo">
        <img src={LogoImg} alt="Logo" className="logo-img" />
      </div>
      <nav className="Header-nav">
        <ul>
          <li><a href="/">Inicio</a></li>
          <li><a href="/Catalogo">Cat치logo</a></li>
          {!isAuthenticated ? (
            <>
              <li><a href="/Iniciar-sesion">Iniciar Sesi칩n</a></li>
              <li><a href="/Registrarse">Registrarse</a></li>
            </>
          ) : (
            <>
              <li><a href="/PerfilUsuarioCliente">Perfil</a></li>
              <li><button onClick={logout}>Cerrar Sesi칩n</button></li>
            </>
          )}
          <li><a href="/Contacto">Cont치ctanos</a></li>
        </ul>
      </nav>
    </header>
  );
}

export default Header;
